import Shorts from "./shorts";
import Home from "./home";
import Detail from "./detail";
import Aside from "../widget/aside";
import React from "react";
import ExceptPage from "./except";
import { Routes, Route, useNavigate } from "react-router-dom";

const Page = (props) => {
  const props2 = props.darkModeState;
  const navigate = useNavigate();
  const pageChangeEvent = (page) => {
    navigate(`/${page.toLowerCase()}`);
  };
  return (
    <>
      <Aside $dark={props.darkModeState} onPageClick={pageChangeEvent} />
      <Routes>
        <Route
          path="/"
          element={
            <Home $dark={props.darkModeState} onPageClick={pageChangeEvent} />
          }
        />
        <Route
          path="/shorts"
          element={<Shorts $dark={props.darkModeState} />}
        />
        <Route
          path="/detail"
          element={<Detail $dark={props.darkModeState} />}
        />
        <Route
          path="/subscribe"
          element={<ExceptPage dark={props.darkModeState} />}
        />
        <Route
          path="/youtubeMusic"
          element={<ExceptPage dark={props.darkModeState} />}
        />
        <Route
          path="/myVideo"
          element={<ExceptPage dark={props.darkModeState} />}
        />
        <Route
          path="/offline"
          element={<ExceptPage dark={props.darkModeState} />}
        />
      </Routes>
    </>
  );
};
export default Page;
